Break Clause
In the event that one of the following conditions are met, the Tenant may serve upon the Landlord or the Landlord’s Agent not less than 30 (thirty) days written notice to end the tenancy.
a.	the Tenant is assigned by the Canadian Armed Forces to a new permanent duty location which is at minimum (25) miles greater in distance from the current duty location in order to perform official duties; 
b.	the Tenant is ordered to occupy Government Quarters;
c.	the Tenant is released from active military service; or
d.	if the United Kingdom or Canada become party to a war and the Tenant is unable to occupy the premises for any other diplomatic, military or war related reasons.

